import React from "react";
import { Component } from "react";

class ExpenseItem extends Component {
  constructor() {
    super();
  }

  render() {
    return (
      <div>
        <div>May 11st 2023</div>
        <h2>Car insurance</h2>
        <div>$2322</div>
      </div>
    );
  }
}

export default ExpenseItem;
